import React from 'react';
import axios from "axios";

const getLetterCombos = (numInput) => {
  console.log('getting letter combos for ' + numInput);
  //axios request
  axios
    .post(
        `http://localhost:3100/users`, 
    )
    .then(response => {
        console.log(response)
        //setUsersData(response.data);

    })
    .catch(err => {
        console.log(err)
    });
}

function App() {
  const [numInput, setNumInput] = React.useState('');
  const [letterCombosData, setletterCombosData] = React.useState();

  return (
    <div className="App">
      <h1>Phone Words</h1>
        <input 
          placeholder="e.g 234"
            onChange={(event) => {
                setNumInput(event.target.value);
            }}
            value={numInput}
        />
      <button onClick={async () => {
        getLetterCombos(numInput) 
      }}>Get letter combinations</button>
    </div>
  );
}

export default App;
